	struct SliderPext_t
	{
		const uint64_t* AttackPtr;
		const uint64_t Mask;

		static constexpr uint64_t _pext_u64_emulated(uint64_t val, uint64_t mask)
		{
			uint64_t res = 0;
			for (uint64_t bb = 1; mask != 0; bb += bb) {
				if (val & mask & (0ull - mask)) {
					res |= bb;
				}
				mask &= (mask - 1);
			}
			return res;
		}

		constexpr SliderPext_t(int offset, uint64_t mask) : AttackPtr(SliderPext + offset), Mask(mask) {

		}

		constexpr uint64_t operator[](const uint64_t blocker) const
		{
			if (std::is_constant_evaluated()) {
				return AttackPtr[_pext_u64_emulated(blocker, Mask)];
			}
			else {
				return AttackPtr[_pext_u64(blocker, Mask)];
			}
		}

		constexpr uint64_t Atk_emulated(const uint64_t blocker) const
		{
			return AttackPtr[_pext_u64_emulated(blocker, Mask)];
		}
	};
